import Nav from './Navbar'
import React ,{useEffect,useState}from 'react';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import CircularProgress from '@material-ui/core/CircularProgress';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import axios from "axios";

import {Link} from "react-router-dom"

import {
  useParams,
} from "react-router-dom";
const StyledTableCell = withStyles((theme) => ({
  head: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  body: {
    fontSize: 18,
    color:'black',
    fontFamily:'vardana',
      },
}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
  root: {
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
    },
  },
}))(TableRow);

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];

const useStyles = makeStyles({
  table: {
    minWidth: 700,
  },
});

const Home = ({history}) =>{
  const classes = useStyles();
  const [data,setdata]=useState([]);
 let {id} = useParams();
const [loading,setloading]=useState(false);

useEffect(function(){
   const headers={
    "Access-Control-Allow-Origin": "*",
   }
   setloading(true);
 axios.get(`http://localhost:9000/users/data/HDFC`,{
        headers}).then(
        (res)=>{
          setdata(res.data.data[id]);
          setloading(false);
        })
        .catch((err)=>{
          setloading(false);
        console.log("error");
        })
        console.log("hi")
      },[history])    
console.log(data);
console.log(history.location.pathname)
  return(
    <>
    <Nav/>
    <div className="tableSelect">
    <Link className="navT" exact activeClassName="acT"  to="/data/psar">PSAR Trend</Link>
    <Link  className="navT" exact activeClassName="acT" to="/data/adx">ADX Indicators</Link>
    <Link className="navT" exact activeClassName="acT"  to="/data/rsi">RSI Indicators</Link>
    <Link  className="navT" exact activeClassName="acT" to="/data/macd">MACD Indicators</Link>
    <Link className="navT" exact activeClassName="acT"  to="/data/mfi">MFI Oscillators</Link>
    <Link  className="navT" exact activeClassName="acT" to="/data/cci">CCI Oscillators</Link>
    <Link  className="navT" exact activeClassName="acT" to="/data/wr">William %R Indicators</Link>
    <Link  className="navT" exact activeClassName="acT" to="/data/bb">Bollinger Bands</Link>
    <Link  className="navT" exact activeClassName="acT" to="/data/stoch">Stochastic Oscillators</Link>
    <Link  className="navT" exact activeClassName="acT" to="/data/ichimoku"> Chimoku Cloud</Link>    
    </div>
    <div className="tablesCSS">     
         {loading ? (
              <div
                style={{
                  height: '30vh',
                  display: 'flex',
                  width: '100%',
                  justifyContent: 'center',
                  alignItems: 'center',
                }}
              >
              <CircularProgress
              style={{width:"60px",height:"60px"}}
      />
              </div>
            ) : (
              <>
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>Dessert (100g serving)</StyledTableCell>
            <StyledTableCell align="right">Calories</StyledTableCell>
            <StyledTableCell align="right">Fat&nbsp;(g)</StyledTableCell>
            <StyledTableCell align="right">Carbs&nbsp;(g)</StyledTableCell>
            <StyledTableCell align="right">Protein&nbsp;(g)</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <StyledTableRow key={row.name}>
              <StyledTableCell component="th" scope="row">
                {row.name}
              </StyledTableCell>
              <StyledTableCell align="right">{row.calories}</StyledTableCell>
              <StyledTableCell align="right">{row.fat}</StyledTableCell>
              <StyledTableCell align="right">{row.carbs}</StyledTableCell>
              <StyledTableCell align="right">{row.protein}</StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </>
    )
}
    </div>
    
    
    </>
  )
}

export default Home
